import React from 'react';
import styled from 'styled-components/macro';
import hardcodedShoppingCartContent from './data/hardcodedShoppingCartContent.js';




export default function ShoppingCart(hardcodedShoppingCartContent) {

    // const ShoppingCartContent = hardcodedShoppingCartContent.filter((item) => hardcodedShoppingCartContent.id !== 11);


    return (
        <div>
            <h1>Einkaufsliste</h1>
            <div>
                {ShoppingCartContent.map((item) => 
                    <ShoppingCartItemFlex
                        key={item.id}
                        description={item.articledescription}
                        amount={item.amount}
                        area={item.area}
                    />
                )}
            </div>

        </div>


    )
}


const ShoppingCartItemFlex = styled.div`
    height: 15vw;
    left: 5px;
    right: 5px;
    display: flex;
    background-color: hotpink;
`
